import React , {Component} from "react";
import {Rov,Coli,Container,Button, Row} from "react-bootstrap";

class RobotState extends CompositionEvent {
    state={};

    render() {
        return(
            <div>
<Row>
            <col>
            <h4>Position</h4>
            <p className="mt-0">x: </p>
            <p className="mt-0">y: </p>
            <p className="mt-0">z: </p>
            </col>
</Row>
            </div>
        );
    }
}

export default RobotState;
